import React from 'react'

const Home = () => {
    return (
        <div>
            <select style={{alignItems: 'center'}}>
                <option value='100'>100</option>
                <option value='108'>108</option>
                <option value='93'>93</option>
            </select>

        </div>
    )
}

export default Home
